import { BrowserRouter, Route} from 'react-router-dom';
import LoginPage from './components/page/LoginPage';
import NavHaapi from './components/NavHaapi';

function App() {
  return (
    <>
    <BrowserRouter>
          <NavHaapi />
          <Route path="" >
          <LoginPage/>
          </Route>
          <Route path="/about">
          </Route>
          <Route path="/contact">
          </Route>
    </BrowserRouter>

    </>

  );
}

export default App;
